— 1,6 л 8кл;
— 75,6х82,4;
— Рессивер впуск Stinger Sport с доработкой;
— дроссель 54мм;
— облегченные клапаны;
— фаски седел увеличены в диаметре;
— распредвал "Нуждин 10.93";
— форсунки "Волга";
— степень сжатия 10.8;
— пружины клапанов с измененным преднатягом;
— колено с маховиком отбалансированы (маховик облегчен на 1,175 кг);
— блокировка дифференциала с преднатягом в 5,7 кг;
— фильтр нулевого сопротивления;
— полностью переделана подвеска на базе стоек Плаза-Спорт газ/масло (стойки, пружины, опоры, стабилизатор, крабы, растяжки);
— прямоточная выхлопная система: Stinger Sport(2017г)
— КПП: ряд 18, пара 4.1, короткоходная кулиса, 6-ти ступенчатая (6 вперед+1 назад :) );
— мозг "Январь 5.1";
— индивидуальная программа, таблица прописана до 7300 об/мин (отсечка), 130л.с.
На учёт встаёт без проблем

— зеркала заднего вида с обогревом;
— зимние бескаркасные дворники;
— ручки дверей заменены с замками на бесшумные евро;

— установлен обвес RS-2 с антикрылом;
— убраны все внешние опознавательные знаки;
— фары StreetStorm с ксеноном 5000К в линзованной фаре на ближний свет;
— нестандартные боковые повторители поворотников под цвет кузова;
— выполнена покраска мерцающим эффектом.

— передние тормоза на 15'' -х вентилируемых перфорированных дисках и цилиндрах производства "Pilenga" с колодками "ProSport";
— задние тормоза на 13"-х перфорированных дисках производства "Pilenga" и суппортом в сборе от "Lucas" с тросиковым ручником и тормозными колодками "Textar";
— для регулировки тормозного усилия на задних дисках в салоне установлен регулятор давления "Sandtler"

Так же с 2018 было заменено:
Все датчики: дмрв, дпдз, дса, холостого, на масло, дд
Провода высоковольтные, фильтр нулевого
Совсем недавно прокладку головы блока, клапанной крышки, естественно впуска выпуска
Топливные магистрали, 
В общем я делал все) 
Недавно совсем радик новый и прокладки в движке (выше писал)


В конце 2019 был возгорание проводки под торпедой, пришлось удалить завод с кнопки, датчик пальца, магнитолу, ну и в общем поразбираться с проводами


Вентилятор обогрева напрямую с кнопки 
