И сопутсвующие работы делал естественно

Кузов обработан предварительно зачищено и тд: пороги, арки перед, зад, задница, днище 
Треснут передний бампер(есть новый) 
И задняя пассажирская дверь, чуток замята, около ручки двери
Я бы заменил мозги честно! 

А так двига продержится при спорт режиме лет 5 (со всем навесным естественно) 
